Inspeksjonsluker monteres i rimelig antall i kanalnettet slik at forskriftsmessig rengj\'f8ring kan finne sted. For kanaler som kan f\'e5 fettavleiringer eller ved trang montasje, skal lukene monteres i bunn av kanal.\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1044{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\cf1\b\f0\fs20 TEKNISK MONTASJE.\b0\par
Dersom montasje av maskinelt utstyr ikke er medtatt i enhetsprisene for utstyret, spesifiseres prisene i denne post.\par
}

